import React from 'react';
import './Workout.css';
import { useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";

const Workout = ({exerciseTargets}) => {

    return (
        <>
        {exerciseTargets.map(exerciseTarget => <div>{exerciseTarget.exercise_Id}</div>)}
        {exerciseTargets.map(exerciseTarget => <div> Sets {exerciseTarget.sets}</div>)}
        {exerciseTargets.map(exerciseTarget => <div>{exerciseTarget.reps}</div>)}
        {exerciseTargets.map(exerciseTarget => <div>{exerciseTarget.time}</div>)}
        {exerciseTargets.map(exerciseTarget => <div>{exerciseTarget.distance}</div>)}
        {exerciseTargets.map(exerciseTarget => <div>{exerciseTarget.weight}</div>)}
        </>
    )
}


export default Workout;
